import "./App.css";
const Pokedex = require("pokedex-promise-v2");
const P = new Pokedex();

function App() {
  let interval = {
    limit: 100,
    offset: 0,
  };
  P.getPokedexsList(interval)
    .then((response) => {
      console.log(response);
    })
    .catch((err) => console.log("Error: ", err));
  return (
    <div className="App">
      <h1>Hello world</h1>
    </div>
  );
}

export default App;
